module.exports = {
  env: {
    browser: true,
    es6: true,
    node: true,
    jest: true,
  },
  extends: ['airbnb', 'plugin:prettier/recommended', 'next/core-web-vitals'],
  globals: {
    Atomics: 'readonly',
    SharedArrayBuffer: 'readonly',
  },
  parserOptions: {
    ecmaFeatures: {
      jsx: true,
    },
    ecmaVersion: 2020,
    sourceType: 'module',
  },
  plugins: ['react'],
  rules: {
    'react/prop-types': 'off',
    'react/jsx-props-no-spreading': 'off',
    'react/react-in-jsx-scope': 'off',
    'react/jsx-filename-extension': [1, { extensions: ['.js', '.jsx'] }],
    'import/prefer-default-export': 'off',
    'no-else-return': 'off',
  },
  settings: {
    'import/resolver': {
      alias: {
        extensions: ['.js'],
        map: [['@', '.']],
      },
    },
  },
};

import nc from 'next-connect';

import cors from 'cors';
import onError from './middlewares/errorHandler';
import cache from './middlewares/cache';
import logger from './middlewares/logger';
import firewall from './middlewares/firewall';

const corsDefaultConfiguration = {
  origin: '*',
  methods: 'GET,HEAD,PUT,PATCH,POST,DELETE,OPTIONS',
  preflightContinue: false,
  optionsSuccessStatus: 204,
};

const cacheDefaultConfiguration = 86400;

const onNoMatch = (request, response) => {
  return response.status(404).json({
    message: 'Page not found.',
    type: 'not_found',
    name: 'NotFoundError',
  });
};

export default (options = {}) => {
  const corsOptions = options.cors || {};
  const cacheOptions = options.cache || cacheDefaultConfiguration;

  const configurations = {
    cors: {
      ...corsDefaultConfiguration,
      ...corsOptions,
    },
    cache: cacheOptions,
  };

  return nc({
    onError,
    onNoMatch,
  })
    .use(cors(configurations.cors))
    .use(firewall)
    .use(logger)
    .use(cache(configurations.cache));
};

module.exports = {
  testTimeout: 30000,
  globals: {
    SERVER_URL: 'http://localhost:3000',
  },
  collectCoverage: true,
  coverageDirectory: '<rootDir>//reports//coverage',
  coverageReporters: ['text', 'lcov', 'html'],
  collectCoverageFrom: [
    'services/**/*.js',
    'graphql/**/**/*.js',
    'pages/api/**/**/*.js',
    '!tests/**/**.test.js',
  ],
  globalSetup: './tests/helpers/server/setup',
  globalTeardown: './tests/helpers/server/teardown',
  testEnvironment: 'node',
};

module.exports = {
  webpack(config) {
    if (config.resolve.fallback) {
      /* eslint-disable no-param-reassign */
      config.resolve.fallback.fs = false;
      /* eslint-enable no-param-reassign */
    }

    /* 
    This rule fix error during building
    with yaml/browser used by fast-xml-parser
    */
    config.module.rules.push({
      test: /node_modules\/yaml\/browser\//,
      type: 'javascript/auto',
    });
    return config;
  },
};

